import React from "react";

const ShortSalesPage = () => {
  return (
    <div className="short-sales-page">
      <h2>Short Sales</h2>
      <p>This is the Short Sales page. Add your short-sales-related features here.</p>
    </div>
  );
};

export default ShortSalesPage;
